Defendant Stephanie Suzanne Roberts in court with attorney Enku Edgar Lin.  Kimberly Dorice Schoepp appeared for the State of Wisconsin.  Sentencing proceeded.  Statements by the State, defense and defendant.
The Court imposed the following sentence:

AS TO COUNT 01:
The Court imposed but stayed 6 months at the House of Correction, consecutive to the sentence in Count 2, and placed defendant on probation for one (1) year, concurrent to probation on Count 2.  
 * Pay the DNA surcharge, plus costs and disbursements, while on probation. 

AS TO COUNT 02:  
The Defendant's TOTAL LENGTH OF SENTENCE shall be 3 years.  Defendant's TERM OF CONFINEMENT in the Wisconsin Prison System shall be for 1-1/2 years with credit for  32 days time served.  Defendant shall serve  1-1/2 years on EXTENDED SUPERVISION.  The defendant is eligible for the Challenge Incarceration Program and the Wisconsin Substance Abuse Program.  The Court advised the defendant of her determinate sentence pursuant to statute and in accordance with Form CR-234.  Copy provided to defendant.   The Court STAYED THE SENTENCE and placed the defendant on probation to the State Department of Corrections for a period of three (3) years. 
 * Court ordered defendant to provide a DNA sample.

CONDITIONS OF PROBATION (and Extended Supervision, if revoked):
 - No contact with Sendiks at 7901 West Layton Avenue, Greenfield, Wisconsin;
 - No contact with Walgreens at 3201 East Layton Avenue, Cudahy, Wisconsin;
 - Undergo a mental health evaluation; follow any treatment recommended;
 - No controlled substances other than those legally prescribed by and deemed necessary by a duly licensed physician/treatment provider; take as prescribed and only for as long as deemed medically reasonable and necessary for defendant's mental and physical health;
 - No alcohol;
 - AODA assessment; treatment, if needed;
 - Urine screens;
 - Anger management counseling;
 - Parenting classes and counseling;
 - Seek and maintain employment;
 - Be given job and vocational training;
 - Cognitive thinking intervention counseling;
 - The Court imposed but stayed 6 months condition time at the House of Correction to be used at the disrection of the agent for any violations;
 - Pay the DNA surcharges, costs and disbursements by the end of probationary period.  Should defendant get revoked and be sent to prison, Court ordered monies taken by the Department of Correction from up to 25% of prison funds.  Balance would be then be paid while on Extended Supervision.   Failure to pay amounts in full would result in a civil judgment entered against defendant.

No restitution was requested; restitution was set at zero.

